import React from 'react';

import {
    Container
} from './../components';

class Index extends React.Component {
    render() {
        return (
            <Container>
    <iframe src="https://pwa-tripcarte-asia.vercel.app/"
            frameborder="0"
            marginheight="0"
            marginwidth="0"
            width="100%"
            height="3000">
  </iframe>
            </Container>
        );
    }
}

export default Index;
